import React, { useState } from 'react';

const UploadHouseForm = () => {
  const [formData, setFormData] = useState({
    structureId: '',
    structureType: 'house',
    userId: '',
    images: [],
    tags: '',
    files: []
  });

  const [error, setError] = useState(null);
  const [emptyFields, setEmptyFields] = useState([]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleImageChange = (e) => {
    const files = Array.from(e.target.files);
    setFormData({
      ...formData,
      images: files
    });
  };

  const handleFileChange = (e) => {
    const files = Array.from(e.target.files);
    const allowedExtensions = ['.pdf', '.obj', '.stl'];
    const validFiles = files.filter(file => {
      const extension = file.name.split('.').pop();
      return allowedExtensions.includes(`.${extension.toLowerCase()}`);
    });

    if (validFiles.length !== files.length) {
      setError('Please upload files with .pdf, .obj, or .stl extensions only.');
    } else {
      setFormData(prevFormData => ({
        ...prevFormData,
        files: [...prevFormData.files, ...validFiles]
      }));
      setError(null);
    }
  };  

  const handleSubmit = async (e) => {
    e.preventDefault();

    const { structureId, userId, images, tags, files } = formData;

    if (!structureId || !userId || images.length === 0 || !files.length) {
      setError('Please fill in all required fields.');
      setEmptyFields(['structureId', 'userId', 'images', 'files']);
      return;
    }

    // Handle form submission, e.g., send formData to backend
    console.log(formData);

    // Clear form data after submission if needed
    setFormData({
      structureId: '',
      structureType: 'house',
      userId: '',
      images: [],
      tags: '',
      files: []
    });

    setError(null);
    setEmptyFields([]);
  };

  const handleCancel = () => {
    // Clear form data and close the form
    setFormData({
      structureId: '',
      structureType: 'house',
      userId: '',
      images: [],
      tags: '',
      files: []
    });
    setError(null);
    setEmptyFields([]);
  };

  return (
    <div className="form-container">
    <form className="create" onSubmit={handleSubmit}> 
      <h3>Upload House Model</h3>

      <label htmlFor="structureId">Structure ID</label>
      <input 
        type="number" 
        id="structureId" 
        name="structureId" 
        value={formData.structureId} 
        onChange={handleChange} 
        className={emptyFields.includes('structureId') ? 'error' : ''}
      />

      <label htmlFor="userId">User ID</label>
      <input 
        type="number" 
        id="userId" 
        name="userId" 
        value={formData.userId} 
        onChange={handleChange} 
        className={emptyFields.includes('userId') ? 'error' : ''}
      />

      <label htmlFor="images">Images</label>
      <input 
        type="file" 
        id="images" 
        name="images" 
        onChange={handleImageChange} 
        multiple 
        accept="image/*" 
        className={emptyFields.includes('images') ? 'error' : ''}
      />

      <label htmlFor="tags">Tags</label>
      <input 
        type="text" 
        id="tags" 
        name="tags" 
        value={formData.tags} 
        onChange={handleChange} 
        className={emptyFields.includes('tags') ? 'error' : ''}
      />

      <label htmlFor="files">Files</label>
      <input 
        type="file" 
        id="files" 
        name="files" 
        onChange={handleFileChange} 
        multiple 
        className={emptyFields.includes('files') ? 'error' : ''}
      />

      <div>
        <button type="submit">Submit</button>
        <button type="button" onClick={handleCancel}>Cancel</button>
      </div>

      {error && <div className="error">{error}</div>}

      {formData.files.length > 0 && (
        <div>
          <h4>Selected Files:</h4>
          <ul>
            {formData.files.map((file, index) => (
              <li key={index}>{file.name}</li>
            ))}
          </ul>
        </div>
      )}
    </form>
    </div>
  );
};

export default UploadHouseForm;
